import React, { useState } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Login from "./pages/page.login";
import SlideMenuAdmin from "./components/component.slidemenu.admin";
import SlideMenuClusterAdmin from "./components/component.slidemenu.clusterAdmin";
import SlideMenuMedicalOfficer from "./components/component.slidemenu.medicalOfficer";
import SlideMenuHeadNurse from "./components/component.slidemenu.headNurse";
import SlideMenuRegDonor from "./components/component.slidemenu.registerDonor";
import Test from "./components/test";
function App() {
   const [loginStatus, setLoginStatus] = useState(false);
   const type = localStorage.getItem("type");

   //admin routes
   if (localStorage.getItem("type") === "1") {
      return (
         <BrowserRouter>
            <Routes>
               <Route path='/dashboard' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
               <Route path='/login' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
            </Routes>
         </BrowserRouter>
      )
   }
   //cluster admin routes
   else if (localStorage.getItem("type") === "2") {
      <BrowserRouter>
         <Routes>
            <Route path='/dashboard' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
            <Route path='/login' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
         </Routes>
      </BrowserRouter>
   }
   //medical Officers routes
   else if (localStorage.getItem("type") === "3") {
      <BrowserRouter>
         <Routes>
            <Route path='/dashboard' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
            <Route path='/login' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
         </Routes>
      </BrowserRouter>

   }
   //head Nurse routes
   else if (localStorage.getItem("type") === "4") {
      <BrowserRouter>
         <Routes>
            <Route path='/dashboard' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
            <Route path='/login' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
         </Routes>
      </BrowserRouter>
   }
   //register Nurse routes
   else if (localStorage.getItem("type") === "5"){
      <BrowserRouter>
         <Routes>
            <Route path='/dashboard' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
            <Route path='/login' exact element={localStorage.getItem("token") ? <SlideMenuAdmin /> : <Login />} />
         </Routes>
      </BrowserRouter>
   }
   else {
      <BrowserRouter>
         <Routes> 
            <Route path='/login' exact element={ <Login />} />
         </Routes>
      </BrowserRouter>
   }


}

export default App;
